import React, { useState } from 'react';
import OpenLinkWebSDK from './OpenLinkWebSDK';
import PopupWindow from './PopupWindow';

const App = () => {
  const [linkToken, setLinkToken] = useState(null);

  const handleLinkTokenFetched = (token) => {
    setLinkToken(token);
  };

  return (
    <div>
      <OpenLinkWebSDK onLinkTokenFetched={handleLinkTokenFetched} />
      {linkToken && <PopupWindow linkToken={linkToken} />}
    </div>
  );
};

export default App;
